import React from 'react';
import iconEther from './img/icon-ethereum.svg'



class CardBody extends React.Component {
    render() {
        return (
            <div className="card-body">
                <h3 className="text-white">Equilibrium #3429</h3>
                <p className="text-white tailleText">Our Equilibrium collement promotes  balance and calm.</p>
                <div className="row d-flex">
                    <div className="col-6 "><img className='img1' src={iconEther} alt="" />
                    <p className="text-white ms-3">0.004 ETH</p>
                    </div>
                    <div className="col-6"></div>
                </div>
            </div>
        )
    }
}

export default CardBody;
